text.Taxonomy and naming:
Eucalyptus kessellii was first formally described in 1925 by Joseph Maiden and William Blakely from a specimen collected near Salmon Gums and the description was published in Journal and Proceedings of the Royal Society of New South Wales. The specific epithet honours Stephen Lackey Kessell.In 1992, Ken Hill and Lawrie Johnson described two subspecies and the names have been accepted by the Australian Plant Census:
Eucalyptus kessellii subsp. eugnosta Hill & Johnson has fruit that are smooth, or have ribs less than 1 mm (0.039 in) high;
Eucalyptus kessellii Maiden & Blakely subsp. kessellii has fruit that are distinctly ribbed, with ribs more than 1 mm (0.039 in) high.
